import React, { useState } from "react";

const ClearAllTodos = () => {
  const word = {
    title: "jopa",
    isComp: false,
  };

  const [done, setDone] = useState(false);
  const changeDone = () => {
    word.isComp = !word.isComp;
    setDone(done);
    console.log(done);
  }

  return (
    <div className="text-white text-center text-2xl">
      <span className={`${word.isComp ? "line-through" : "underline"}`}>{word}</span> <br />
      <button onClick={changeDone}>START</button>
    </div>
  );
};

export default ClearAllTodos;
